import React from 'react';
import '../styleesheets/Dashboard.css';
import '../styleesheets/Proveedores.css';
import { useState } from 'react';
import Axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

function Proveedores() {
    const [razonSocial, setRazonSocial] = useState('');
    const [direccion, setDireccion] = useState(''); // Corregido aquí
    const [telefono, setTelefono] = useState('');
    const [rut, setRut] = useState('');
    const [banco, setBanco] = useState('');
    const [numeroCuenta, setNumeroCuenta] = useState('');
    const [tipoCuenta, setTipoCuenta] = useState('');
    const [proveedorList,setProveedores] = useState ([]);

    const registrarProvedores = () => {
        Axios.post('http://localhost:3001/create', {
            razonSocial: razonSocial,
            direccion: direccion, 
            telefono: telefono,
            rut: rut,
            banco: banco,
            numeroCuenta: numeroCuenta,
            tipoCuenta: tipoCuenta
        }).then(() => {
            alert('Proveedor Registrado!!')
        });
    }

    const getProveedores = () => {
        Axios.get('http://localhost:3001/proveedorList').then((response) => {
            setProveedores(response.data);
        });
    }

    getProveedores();


    return (
        <main>
            <div class="container">

        <div className='dashboard-titulo'>
            <h1>
                Proveedores
            </h1>
        </div>
        <div className='datos-proveedores'>
    <h1>Registrar Proveedores</h1>
    <table>
        <tbody>
            <tr>
                <td><label>Razon Social:</label></td>
                <td><input 
                onChange={(event) => {
                    setRazonSocial(event.target.value)
                }}
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Direccion:</label></td>
                <td><input
                onChange={(event) => {
                    setDireccion(event.target.value)
                }}
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Telefono:</label></td>
                <td><input
                onChange={(event) => {
                    setTelefono(event.target.value)
                }} 
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Rut:</label></td>
                <td><input 
                onChange={(event) => {
                    setRut(event.target.value)
                }}
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Banco:</label></td>
                <td><input 
                onChange={(event) => {
                    setBanco(event.target.value)
                }}
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Numero Cuenta:</label></td>
                <td><input 
                onChange={(event) => {
                    setNumeroCuenta(event.target.value)
                }}
                type='text'/></td>
            </tr>
            <tr>
                <td><label>Tipo Cuenta:</label></td>
                <td><input 
                onChange={(event) => {
                    setTipoCuenta(event.target.value)
                }}
                type='text'/></td>
            </tr>

        </tbody>
    </table>
            <button className='btn btn-success' onClick={registrarProvedores} >Registrar</button>
            <br></br>
</div>

<div className='lista'>
{
    proveedorList.map((val) => {
        return <div key={val.id} className=''>{val.id}</div>
    }) 
}
            </div>
    </div>
    </main>
    );

}

export default Proveedores;
